@ThatEricAlper In high school we listened to KROQ when Jimmy Rabbit, Steven Clean and Frazier Smith were DJs.

Smith would add "dog" to people's names. A friend started calling me Londog, and it stuck

The Lonndoggie variation due to Londog already taken (hrm, seems available now...)

@ThatEricAlper Olympics in LA, W marathon went thru Santa Monica, went to watch. Guy with a portable tv next to me. I look over his shoulder, ask where are they. Then a deep voice says "YA, WHERE ARE DE?"

Arnold, other side.

The three of us figured out where they were. Teamwork!

